import React from "react";
import { BrowserRouter, Switch, Route } from "react-router-dom";
import RegistrationForm from "../imports/RegistrationForm";
import BaseLogin from "../imports/BaseLogin";

function Register() {
  return (
    <BrowserRouter>
      <BaseLogin />
      <RegistrationForm />
    </BrowserRouter>
  );
}

export default Register;
